import React, {Component} from 'react';
import Carusel from "../Componrnts/Carusel";

class Home extends Component {
    render() {
        return (
            <>
            <Carusel/>
            <section>
                <div className={"info-left"}>
                    <p>ФОТОГРАФІЇ – ЧАСТИНА ЛЮДСЬКОГО СПАДИНКУ,
                        І ІНСТРУМЕНТ, ЩО ДОКУМЕНТУЄ НАШЕ ІСНУВАННЯ</p>
                </div>
                <div className={"info-right"}>

                </div>
            </section>
                </>
        );
    }
}

export default Home;
